import Nav from './components/Nav';
import Footer from './components/Footer';

function App() {
  return (
    <div>
      <header>
        <Nav></Nav>
      </header>
      <footer>
        <Footer></Footer>
        <Signature></Signature>
      </footer>
    </div>
  );
}

export default App;
